import React from 'react'
import '../stylesheets/navbar.css';


const NavBar = () => {

    const handleSubmit = async (e) => {
        e.preventDefault();
    
        const userObject = {
          logout:true
        };
    
        console.log(userObject);
        axios
          .post("/auth/logout", userObject)
          .catch((error) => {
            console.log(error);
          });
      };
    return (

        <div className="nav">
            <p className="logo">Splittr</p>
           
            <ul>
                <li>
                    <a href="/">Dashboard</a>

                </li>

                <li>
                    <a href="/newform">Create Share</a>
                </li>

                <li>
                    <button onSubmit={handleSubmit}>Log Out</button>

                </li>
                </ul>
             
        </div>
    );


};
export default NavBar;
